import { useState, useEffect } from "react";

export default function ConfirmedDetail({ url }) {
    const [stats, setStats] = useState();

    useEffect(() => {
        // console.log("Fetching Data");
        async function fetchData() {
            const data = await fetch(url).then(res => res.json());
            setStats(data);
        }
        fetchData();
    }, []);

    console.log(stats);

    return (
        <div>
            <h3>Confirmed</h3>

            <table>
                <thead>
                    <tr>
                        <td>Province</td>
                        <td>Confirmed</td>
                        <td>Recovered</td>
                        <td>Deaths</td>
                        <td>Active</td>
                    </tr>
                </thead>
                {stats &&
                    stats.map((province, i) => {
                        return (
                            <tbody key={i}>
                                <tr>
                                    <td>{province.provinceState}</td>
                                    <td>{province.confirmed}</td>
                                    <td>{province.recovered}</td>
                                    <td>{province.deaths}</td>
                                    <td>{province.active}</td>
                                </tr>
                            </tbody>
                        );
                    })}
            </table>
        </div>
    );
}
